    modalEnableInputTranslationDesc: "\uC2A4\uD398\uC774\uC2A4\uBC14\uB97C \uC5F0\uC18D\uD574\uC11C \uC138 \uBC88 \uBE60\uB974\uAC8C \uB20C\uB7EC \uBAB0\uC785\uD615 \uBC88\uC5ED\uC758 \uC785\uB825 \uC0C1\uC790 \uBC88\uC5ED\uC744 \uD2B8\uB9AC\uAC70\uD588\uC73C\uBA70, \uC785\uB825 \uC0C1\uC790\uC758 \uB0B4\uC6A9\uC774 \uAE30\uBCF8 \uB300\uC0C1 \uC5B8\uC5B4\uB85C \uBC88\uC5ED\uB429\uB2C8\uB2E4. \uBC88\uC5ED\uC740 Ctrl+Z\uB85C \uCDE8\uC18C\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.<br /><br />\uBC88\uC5ED\uC774 \uC2E4\uC218\uC600\uB2E4\uBA74 \uC9C0\uAE08 \uBC14\uB85C \uBE44\uD65C\uC131\uD654\uD558\uAC70\uB098 \uC785\uB825 \uC0C1\uC790 \uBC88\uC5ED\uC744 \uC601\uAD6C\uC801\uC73C\uB85C \uBE44\uD65C\uC131\uD654\uD560 \uC218 \uC788\uC73C\uB2C8 \uAC71\uC815\uD558\uC9C0 \uB9C8\uC138\uC694.",
