    "subtitle.disabledSubtitle": "\uB3D9\uC601\uC0C1 \uC790\uB9C9 \uAE30\uB2A5 \uC601\uAD6C \uBE44\uD65C\uC131\uD654\uD558\uAE30",
    "subtitle.disabledSubtitleDescription": "\uBAB0\uC785\uD615 \uBC88\uC5ED\uAE30\uC758 \uBE44\uB514\uC624 \uC790\uB9C9\uC774 \uB2E4\uB978 \uD655\uC7A5 \uD504\uB85C\uADF8\uB7A8\uACFC \uCDA9\uB3CC\uD558\uB294 \uACBD\uC6B0, \uBAB0\uC785\uD615 \uBC88\uC5ED\uAE30\uC758 \uBE44\uB514\uC624 \uC790\uB9C9 \uAE30\uB2A5\uC744 \uC601\uAD6C\uC801\uC73C\uB85C \uBE44\uD65C\uC131\uD654\uD558\uAC70\uB098 \uCDA9\uB3CC\uD558\uB294 \uB2E4\uB978 \uD655\uC7A5 \uD504\uB85C\uADF8\uB7A8\uC744 \uC81C\uAC70\uD558\uB3C4\uB85D \uC120\uD0DD\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.",
    "subtitle.autoEnableSubtitle": "\uC774\uC911 \uC5B8\uC5B4 \uC790\uB9C9 \uC790\uB3D9 \uC0AC\uC6A9",
