    "subtitle.preTranslation": "\uBAB0\uC785\uD615 \uBC88\uC5ED\uC744 \uC0AC\uC6A9\uD558\uC5EC \uC790\uB9C9 \uBC88\uC5ED\uD558\uAE30",
    "subtitle.preTranslationDescription": "\uD65C\uC131\uD654\uD558\uBA74 \uC544\uB798\uC5D0 \uBA85\uC2DC\uB41C \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB97C \uC0AC\uC6A9\uD558\uC5EC \uC804\uCCB4 \uC790\uB9C9\uC774 \uC0AC\uC804 \uBC88\uC5ED\uB418\uBA70, 1\uC2DC\uAC04 \uBD84\uB7C9\uC758 \uB3D9\uC601\uC0C1\uC740 \uC57D 50,000 \uD1A0\uD070 \uB610\uB294 \uBB38\uC790\uB97C \uC18C\uBAA8\uD558\uBBC0\uB85C \uC2E0\uC911\uD558\uAC8C \uC0AC\uC6A9\uD558\uC2DC\uAE30 \uBC14\uB77C\uBA70, \uBE44\uD65C\uC131\uD654\uD558\uBA74 \uC6D0\uBCF8 \uC790\uB9C9\uC774 \uBA3C\uC800 \uC0AC\uC6A9\uB429\uB2C8\uB2E4.",
    "subtitle.humanSubtitlesPreferred": "\uD734\uBA3C \uCEA1\uC158 \uC6B0\uC120 \uC0AC\uC6A9",
    "subtitle.humanSubtitlesPreferredDescription": "\uB3D9\uC601\uC0C1\uC5D0 \uB300\uC0C1 \uC5B8\uC5B4\uB85C \uB41C \uC0AC\uB78C \uC790\uB9C9\uC774 \uC788\uB294 \uACBD\uC6B0 \uC0AC\uB78C \uC790\uB9C9\uC744 \uC6B0\uC120\uC801\uC73C\uB85C \uC0AC\uC6A9\uD569\uB2C8\uB2E4(\uAD8C\uC7A5).",
    videoSubtitleTranslationDescription: "\uB3D9\uC601\uC0C1 \uC790\uB9C9\uC744 \uC704\uD55C \uBCC4\uB3C4\uC758 \uBC88\uC5ED \uC11C\uBE44\uC2A4 \uC9C0\uC815",
