    "description.action": "\uD65C\uC131\uD654\uD558\uBA74 \uC694\uCCAD\uC5D0 action=1 \uB9E4\uAC1C\uBCC0\uC218\uAC00 \uCD94\uAC00\uB418\uC5B4 \uBC14\uC774\uB450\uC5D0 \uD65C\uC131\uD654\uB41C \uC6A9\uC5B4\uB97C \uC54C\uB9B4 \uC218 \uC788\uC73C\uBA70, <1>\uC790\uC138\uD55C \uB0B4\uC6A9\uC740 \uACF5\uC2DD \uBB38\uC11C\uB97C \uCC38\uC870\uD558\uC138\uC694</1>.",
