    "floatBall.close": "\uD638\uBC84\uBCFC \uB2EB\uAE30",
    "floatBallOptions.enableDescPc": "\uD398\uC774\uC9C0 \uD638\uBC84\uBCFC\uC744 \uD65C\uC131\uD654\uD558\uBA74 \uD398\uC774\uC9C0 \uC624\uB978\uCABD\uC5D0 \uBE60\uB978 \uBC88\uC5ED \uBC84\uD2BC\uC774 \uD45C\uC2DC\uB418\uBA70, \uC774\uB97C \uD074\uB9AD\uD558\uBA74 \uBC88\uC5ED\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4!",
    "floatBallOptions.enableDesc": "\uD638\uBC84\uBCFC\uC744 \uB044\uACE0 \uB098\uBA74{touch}\uC73C\uB85C \uBD88\uB7EC\uC62C \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC2E4\uC218\uB85C \uC774 \uC635\uC158\uC744 \uB048 \uD6C4 \uD638\uBC84\uBCFC\uC744 \uCC3E\uC744 \uC218 \uC5C6\uB294 \uACBD\uC6B0\uB97C \uB300\uBE44\uD574 \uC774 \uC124\uC815 \uD398\uC774\uC9C0\uB97C \uBD81\uB9C8\uD06C\uC5D0 \uCD94\uAC00\uD574 \uB450\uB294 \uAC83\uC774 \uC88B\uC2B5\uB2C8\uB2E4!",
    "description.azureApiUrl": "\uC0AC\uC6A9\uC790 \uC9C0\uC815 API \uC778\uD130\uD398\uC774\uC2A4\uC758 \uC8FC\uC18C\uB97C \uC785\uB825\uD569\uB2C8\uB2E4.",
    confirmSupportMouse: "\uB9C8\uC6B0\uC2A4 \uC9C0\uC6D0 \uAC15\uC81C \uD65C\uC131\uD654",
    confirmSupportMouseDescription: "\uD604\uC7AC \uBE0C\uB77C\uC6B0\uC800\uAC00 \uB9C8\uC6B0\uC2A4 \uAE30\uB2A5\uC744 \uC9C0\uC6D0\uD558\uC9C0 \uC54A\uB294 \uAC83\uC73C\uB85C \uAC10\uC9C0\uB418\uBA74 \uB9C8\uC6B0\uC2A4 \uC9C0\uC6D0\uC744 \uAC15\uC81C\uB85C \uD65C\uC131\uD654\uD574\uC57C \uD558\uB098\uC694?",
    sampleTargetText: "\uAE34 \uBC24\uC774 \uC62C \uAC83\uC774\uB2C8, \uB098\uB294 \uC624\uB298\uBD80\uD130 \uC8FD\uC744 \uB54C\uAE4C\uC9C0 \uBCF4\uCD08\uB97C \uC124 \uAC83\uC774\uB2E4. \uB098\uB294 \uC544\uB0B4\uB97C \uCDE8\uD558\uC9C0 \uC54A\uC744 \uAC83\uC774\uBA70, \uB3D9\uB9F9\uC744 \uB9FA\uC9C0 \uC54A\uC744 \uAC83\uC774\uBA70, \uC790\uC2DD\uC744 \uB0B3\uC9C0 \uC54A\uC744 \uAC83\uC774\uB2E4. \uB098\uB294 \uC655\uAD00\uC744 \uC4F0\uC9C0 \uC54A\uC744 \uAC83\uC774\uBA70 \uBA85\uC608\uB97C \uC704\uD574 \uB178\uB825\uD558\uC9C0 \uC54A\uC744 \uAC83\uC774\uB2E4. \uB098\uB294 \uB0B4 \uC758\uBB34\uB97C \uB2E4\uD558\uACE0 \uC0B4\uB2E4\uAC00 \uC8FD\uC744 \uAC83\uC785\uB2C8\uB2E4.",
    sampleSourceText: "Night gathers, and now my watch begins. It shall not end until my death. I shall take no wife, hold no lands, father no children. I shall wear no crowns and win no glory. I shall live and die at my post.",
    "subtitle.supportedSites": "\u5DF2\u652F\u6301\u5728\u8FD9\u4E9B\u7F51\u7AD9\u4F7F\u7528\u53CC\u8BED\u5B57\u5E55\uFF08\u6CE8\u610F\uFF1A\u7531\u4E8E\u6280\u672F\u9650\u5236\uFF0C\u90E8\u5206\u7F51\u7AD9\u5728\u9996\u6B21\u5F00\u542F\u5B57\u5E55\u540E\u9700\u8981\u91CD\u65B0\u5237\u65B0\u9875\u9762\uFF0C\u6216\u8005\u9700\u7B49\u5F85\u7FFB\u8BD1\u5B8C\u6210\u4EE5\u663E\u793A\u53CC\u8BED\u5B57\u5E55\uFF09\uFF1A",
