    videoSubtitlePreTranslationOn: "\uBE44\uB514\uC624 \uC790\uB9C9\uC740 \uC6B0\uC120\uC801\uC73C\uB85C \uBAB0\uC785\uD615 \uBC88\uC5ED\uC744 \uC0AC\uC6A9\uD560 \uAC83\uC785\uB2C8\uB2E4.",
