    "translationModeUrl.translation.description": "\uB2E4\uC74C \uB3C4\uBA54\uC778\uC5D0 \uB300\uD55C \uC6F9\uC0AC\uC774\uD2B8\uC77C \uACBD\uC6B0, \uC790\uB3D9\uC73C\uB85C \uBC88\uC5ED\uBB38\uB9CC \uBAA8\uB4DC\uB97C \uC0AC\uC6A9\uD569\uB2C8\uB2E4.",
    "error.openAIExceededQuota": "\uC11C\uBE44\uC2A4 \uC624\uB958 \uBC18\uD658: \uD604\uC7AC OpenAI \uACC4\uC815 \uC794\uC561\uC774 \uBD80\uC871\uD569\uB2C8\uB2E4. OpenAI \uACF5\uC2DD \uAD00\uB9AC \uD398\uC774\uC9C0\uC5D0\uC11C \uCDA9\uC804\uD558\uAC70\uB098 \uC2E0\uC6A9\uCE74\uB4DC\uB97C \uC5F0\uACB0\uD574\uC8FC\uC138\uC694.",
    "error.400": "\uC11C\uBE44\uC2A4\uAC00 \uC624\uB958\uB97C \uBC18\uD658\uD588\uC2B5\uB2C8\uB2E4. \uC694\uCCAD \uB9E4\uAC1C\uBCC0\uC218\uAC00 \uC798\uBABB\uB418\uC5C8\uC2B5\uB2C8\uB2E4. \uD574\uB2F9 \uC124\uC815\uC744 \uD655\uC778\uD558\uC2ED\uC2DC\uC624.",
    "error.gemini.429": "\uD604\uC7AC Gemini \uC11C\uBE44\uC2A4\uC758 \uD604\uC7AC \uBD80\uD558 \uC6A9\uB7C9\uC774 \uCD5C\uB300\uC5D0 \uB3C4\uB2EC\uD588\uC2B5\uB2C8\uB2E4. \uC7A0\uC2DC \uD6C4\uC5D0 \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uAC70\uB098 \uB2E4\uB978 \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB85C \uC804\uD658\uD574 \uC8FC\uC138\uC694.",
    "translationFont.notSupportErrorMessage": "\uC785\uB825\uD558\uC2E0 \uAE00\uAF34 \uC774\uB984\uC774 \uC815\uD655\uD55C\uC9C0 \uD655\uC778\uD558\uC2DC\uAC70\uB098, \uD574\uB2F9 \uAE00\uAF34\uC774 \uADC0\uD558\uC758 \uC7A5\uCE58\uC5D0 \uC124\uCE58\uB418\uC5B4 \uC788\uB294\uC9C0 \uD655\uC778\uD574 \uC8FC\uC138\uC694.",
    "error.openAIFreeLimit": "\uC11C\uBE44\uC2A4\uAC00 \uC624\uB958\uB97C \uBC18\uD658\uD588\uC2B5\uB2C8\uB2E4. \uD604\uC7AC \uBC88\uC5ED \uC694\uCCAD \uBE48\uB3C4\uAC00 \uBD84\uB2F9 \uCD5C\uB300 3\uD68C\uB85C \uC81C\uD55C\uB418\uC5C8\uC2B5\uB2C8\uB2E4. \uC7A0\uC2DC \uD6C4 \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uC2ED\uC2DC\uC624. (\uC774\uAC83\uC740 OpenAI \uACF5\uC2DD\uC774 \uBB34\uB8CC API Key\uC5D0 \uB300\uD55C \uC81C\uD55C\uC774\uBA70, \uC774 \uC81C\uD55C\uC744 \uD574\uC81C\uD558\uB824\uBA74 OpenAI \uAD00\uB9AC \uBC31\uC5D4\uB4DC\uC5D0\uC11C \uC2E0\uC6A9\uCE74\uB4DC\uB97C \uC5F0\uACB0\uD558\uC2ED\uC2DC\uC624.)",
    "desc.toggleVideoSubtitlePreTranslation": "\uB204\uB974\uBA74 \uBE44\uB514\uC624\uC758 \uC774\uC911 \uC5B8\uC5B4 \uC790\uB9C9\uC740 \uC6B0\uC120\uC801\uC73C\uB85C \uBAB0\uC785\uD615 \uBC88\uC5ED \uC124\uC815\uC744 \uC0AC\uC6A9\uD558\uACE0, \uB2E4\uC2DC \uB204\uB974\uBA74 \uC6D0\uB798 \uBE44\uB514\uC624\uC5D0 \uB0B4\uC7A5\uB41C \uAE30\uACC4 \uBC88\uC5ED \uC790\uB9C9\uC744 \uC6B0\uC120\uC801\uC73C\uB85C \uC0AC\uC6A9\uD569\uB2C8\uB2E4. \uC8FC\uC758: \uC774 \uB2E8\uCD95\uD0A4\uB294 \uC804\uC5ED \uC124\uC815\uC744 \uC218\uC815\uD569\uB2C8\uB2E4.",
    "error.429": "\uC11C\uBE44\uC2A4\uAC00 \uC624\uB958\uB97C \uBC18\uD658\uD588\uC2B5\uB2C8\uB2E4. \uC774\uB294 \uC694\uCCAD\uC774 \uB108\uBB34 \uC790\uC8FC \uBC1C\uC0DD\uD558\uAC70\uB098 \uD560\uB2F9\uB7C9 \uC81C\uD55C\uC744 \uCD08\uACFC\uD588\uC74C\uC744 \uB098\uD0C0\uB0C5\uB2C8\uB2E4. \uC7A0\uC2DC \uD6C4\uC5D0 \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uC2ED\uC2DC\uC624.",
    "error.serveUnavailable": "\uD604\uC7AC \uC0AC\uC6A9 \uC911\uC778 [{serverName}] \uC11C\uBE44\uC2A4\uB294 \uB124\uD2B8\uC6CC\uD06C \uC5F0\uACB0 \uB610\uB294 \uC11C\uBE44\uC2A4 \uC81C\uACF5\uC790\uC758 \uBB38\uC81C\uB85C \uC778\uD574 \uC77C\uC2DC\uC801\uC73C\uB85C \uC811\uC18D\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4. \uD398\uC774\uC9C0\uB97C \uC0C8\uB85C \uACE0\uCE68\uD558\uAC70\uB098 <1>\uC124\uC815</1>\uC744 \uD1B5\uD574 \uB2E4\uB978 \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB85C \uBCC0\uACBD\uD574 \uBCF4\uC2DC\uB294 \uAC83\uC744 \uAD8C\uC7A5\uD569\uB2C8\uB2E4. <2>Pro \uD68C\uC6D0</2>\uC774\uC2DC\uB77C\uBA74, \uB354 \uC548\uC815\uC801\uC778 DeepL \uB610\uB294 OpenAI \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB97C \uC0AC\uC6A9\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4(<3>\uC5EC\uAE30\uB97C \uD074\uB9AD\uD558\uC2DC\uBA74 \uBB34\uB8CC\uB85C \uCCB4\uD5D8\uD558\uC2E4 \uC218 \uC788\uC2B5\uB2C8\uB2E4</3>). \uB610\uD55C, \uB124\uD2B8\uC6CC\uD06C \uB610\uB294 \uD504\uB85D\uC2DC \uC124\uC815\uC744 \uD655\uC778\uD574\uC57C \uD560 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4.",
