    "browser.translateWithTransmart": "\uC784\uC2DC\uB85C \uD150\uC13C\uD2B8 \uBC88\uC5ED\uC744 \uC0AC\uC6A9\uD558\uC5EC \uD604\uC7AC \uD398\uC774\uC9C0\uB97C \uBC88\uC5ED\uD558\uC2ED\uC2DC\uC624.",
    upgradeToProErrorTitle: "\uC774 \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB97C \uC0AC\uC6A9\uD558\uB824\uBA74 Pro \uD68C\uC6D0\uC73C\uB85C \uC5C5\uADF8\uB808\uC774\uB4DC\uD558\uC2ED\uC2DC\uC624.",
