    touchShortcutsToggleTranslationMask: "\uD130\uCE58 \uC2A4\uD06C\uB9B0 \uC81C\uC2A4\uCC98 \uC124\uC815\uD558\uC5EC \uBC88\uC5ED \uB9C8\uC2A4\uD06C \uD45C\uC2DC / \uC6D0\uBB38 \uD45C\uC2DC",
