    "browser.brandDescriptionForSafari": "\u3010\uBAB0\uC785\uD615 \uBC88\uC5ED\u3011\uBB34\uB8CC\uC758 (\uC6D0\uBB38/\uBC88\uC5ED\uBB38) \uC774\uC911 \uC5B8\uC5B4 \uB300\uC870 \uC6F9 \uD398\uC774\uC9C0 \uBC88\uC5ED \uD50C\uB7EC\uADF8\uC778\uC73C\uB85C, PDF \uBC88\uC5ED \uBC0F EPUB \uC804\uC790\uCC45 \uBC88\uC5ED\uC744 \uC9C0\uC6D0\uD558\uBA70 \uC6D0\uBB38\uC758 \uBB38\uC11C \uBC30\uCE58\uB97C \uC720\uC9C0\uD569\uB2C8\uB2E4. Youtube/Netflix \uB4F1\uC758 \uC628\uB77C\uC778 \uBE44\uB514\uC624 \uC774\uC911 \uC5B8\uC5B4 \uC790\uB9C9 \uBC88\uC5ED\uC744 \uC9C0\uC6D0\uD558\uBA70, Deepl/Google \uB4F1 \uC8FC\uC694 \uBC88\uC5ED \uC11C\uBE44\uC2A4\uB97C \uC9C0\uC6D0\uD569\uB2C8\uB2E4.",
